BEGIN;

CREATE TABLE "policy" (
    id INTEGER PRIMARY KEY
  , account_id INTEGER
  , enabled INT DEFAULT(0)
  , asset_id INTEGER
  , type TEXT
  , cash TEXT
  , cash_into TEXT DEFAULT(0.00)
  , cash_inuse TEXT DEFAULT(0.00)
  , condition TEXT
  , asset_count TEXT DEFAULT(0)
  , timestamp TEXT
  , execution_time TEXT
);


COMMIT;